    const nonSelectedMovieTheaters: movieTheaterDTO[] = [{ id: 1, name: 'Sambil' }, { id: 2, name: 'Agora' }]

    // const selectedGenres: genreDTO[] = [{ id: 1, name: 'Comedy' }, { id: 2, name: 'Drama' }]
