        <>
            <h3>Create Movies</h3>
            <MovieForm model={{ title: '', inTheaters: false, trailer: '' }}
                onSubmit={values => console.log(values)}
                selectedGenres={[]}
                nonSelectedGenres={nonSelectedGenres}
                nonSelectedMovieTheaters={nonSelectedMovieTheaters}
            />

        </>
    )
}
